public class RelationOp17 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int a=1, b=2, c=-3;
		int s = a++ + b-- * c++;
		
		System.out.println("a = "+a);
		System.out.println("b = "+b);
		System.out.println("c = "+c);
		System.out.println("s = "+s);
		
		
	}

}

